import { useState } from "react";
import iconCart from "../../images/icon-cart.svg";
import avatar from "../../images/image-avatar.png";

const RightNav = () => {
  const [hover, setHover] = useState(false);

  function mouseHandle(e) {
    setHover(true);
  }

  return (
    <div className="rightNav flex items-center justify-end w-3/12 bg-blue-3 relative">
      <div className="cart pr-8 pl-3">
        <img onMouseMove={mouseHandle} src={iconCart} alt="cart-button" />
        <div className="cart-modal absolute inset-x-0 bottom-0 border-2 rounded-md w- h-5/6 bg-primary-1">Hi, this is my cart</div>
      </div>

      <a href="#">
        <img src={avatar} width={50} alt="profile-avatar" className="outline rounded-full hover:outline-primary-1 outline-transparent outline-2" />
      </a>
    </div>
  );
};

export default RightNav;
